                <HeaderCenter>
                    <div className="header-main">
                        <img className="main-logo" src={TCPLogo} alt="" />
                    </div>
                </HeaderCenter>
                <HeaderRight></HeaderRight>
            </Header>

            <div className="sub-header">
                <button>
                    <img src={IconContactAcitve} alt=""/> 
                    <span>Applicant(s) Details</span>
                    <span className='arrow-down'></span>
                </button>
            </div>

            <form onSubmit={(e) => handleSubmit(e)} noValidate>
                {dealer.id &&
                    <Input
                        name="id"
                        type="hidden"
                        value={dealer.id}
                    />
                }
                <div className="container">
                    <div className="styled-form">

                        <div className="box radio-box">
                            <label class="form-label" style={{marginRight: 45}}>Staff Type: </label>
                            <Form.Group className="mb-18 radio-filed">
                                <Input 
                                    id ="sales"
                                    name="role"
                                    type="radio"
                                    className="radio-width"
                                    defaultValue="sales"
                                    // checked={staff.role && staff.role[0] == 'sales' ? true : null}
                                />
                                <label for="sales" class="form-label " id="sales-label">Salesperson</label>  
                            </Form.Group>
                            <Form.Group className="mb-18 radio-filed">
                                <Input 
                                    id ="dealer"
                                    name="role"
                                    type="radio"
                                    className="radio-width"
                                    defaultValue="dealer"
                                    // checked={staff.role && staff.role[0] == 'dealer' ? true : null}
                                />
                                <label for="dealer" class="form-label " id="staff-label">Dealer</label>
                            </Form.Group>
                        </div>




                        <Form.Group className="mb-18">
                            <Input
                                name="first_name"
                                type="text"
                                // defaultValue={dealer.company_name}
                                label="Applicant First Name"
                                defaultText="Applicant First Name"
                                required={true}
                                error={{
                                    'empty': "Please enter Applicant First Name"
                                }}
                                validationResult={validationResult}
                            />
                        </Form.Group>
                        <Form.Group className="mb-18">
                            <Input
                                name="last_name"
                                type="text"
                                // defaultValue={dealer.company_name}
                                label="Applicant Last Name"
                                defaultText="Applicant Last Name"
                                required={true}
                                error={{
                                    'empty': "Please enter Applicant Last Name"
                                }}
                                validationResult={validationResult}
                            />
                        </Form.Group>
                        <Form.Group className="mb-18">
                            <Input
                                name="email"
                                type="email"
                                regex="^[a-zA-Z0-9+_.-]+@[a-zA-Z0-9.-]+$"
                                // defaultValue={dealer.email}
                                label="Email"
                                defaultText="Email"
                                required={true}
                                error={{
                                    'invalid': "Please enter valid Email address",
                                    'empty': "Please enter Email Address"
                                }}
                                validationResult={validationResult}
                            />
                        </Form.Group>
                        <Form.Group className="mb-18">
                            <Input
                                name="phone"
                                type="text"
                                // defaultValue={dealer.phone}
                                label="Phone"
                                className="medium-input"
                                defaultText="999-999-9999"
                                regex="[0-9]{10}"
                                required={true}
                                error={{
                                    'invalid': "Please enter 10 digit number",
                                    'empty': "Please enter Phone number"
                                }}
                                validationResult={validationResult}
                            />
                        </Form.Group>
                        <Form.Group className="mb-18">
                            <Input
                                name="date_of_work"
                                type="date"
                                // defaultValue={dealer.phone}
                                label="Date of Birth"
                                className="medium-input"
                                defaultText="MM / DD / YYYY"
                                required={true}
                                error={{
                                    'empty': "Please enter date of birth"
                                }}
                                validationResult={validationResult}
                            />
                        </Form.Group>
                        <Form.Group className="mb-18">
                            <Input
                                name="ssn"
                                type="text"
                                // defaultValue={dealer.company_name}
                                label="SSN"
                                defaultText="SSN"
                                required={true}
                                error={{
                                    'empty': "Please enter ssn number"
                                }}
                                validationResult={validationResult}
                            />
                        </Form.Group>
                        <Form.Group className="mb-18">
                            <Input
                                name="driver_license"
                                type="text"
                                // defaultValue={dealer.company_name}
                                label="Driver License Number"
                                defaultText="Driver License Number"
                                required={true}
                                error={{
                                    'empty': "Please enter Driver License Number"
                                }}
                                validationResult={validationResult}
                            />
                        </Form.Group>
                        <Form.Group className="mb-18">
                            <Input
                                name="number_of_dependants"
                                type="number"
                                // defaultValue={dealer.company_name}
                                label="Number of Dependants"
                                defaultText="0"
                                className="small-input"
                                required={true}
                                error={{
                                    'empty': "Please enter Number of Dependants"
                                }}
                                validationResult={validationResult}
                            />
                        </Form.Group><Form.Group className="mb-18">
                            <Input
                                name="street"
                                type="text"
                                defaultValue={dealer.street}
                                label="Street"
                                defaultText="Street"
                                required={true}
                                error={{
                                    'empty': "Please enter Street"
                                }}
                                validationResult={validationResult}
                            />
                        </Form.Group>
                        <Form.Group className="mb-18">
                            <Input
                                name="city"
                                type="text"
                                // defaultValue={dealer.city}
                                label="City"
                                defaultText="City"
                                required={true}
                                error={{
                                    'empty': "Please enter city"
                                }}
                                validationResult={validationResult}
                            />
                        </Form.Group>
                        <div className="styled-row">
                            <Form.Group className="styled-column mb-18">
                                <Input
                                    name="zip"
                                    type="number"
                                    // defaultValue={dealer.zip}
                                    regex="[0-9]{6}"
                                    label="Zip Code"
                                    defaultText="Zip Code"
                                    maxLength={6}
                                    required={true}
                                    error={{
                                        'invalid': "Please enter 6 digit number",
                                        'empty': "Please enter zip code"
                                    }}
                                    validationResult={validationResult}
                                />
                            </Form.Group>
                        </div>
                        <Form.Group className="mb-18">
                            <Checkbox
                                name="have_co_applicant"
                                type="checkbox"
                                label="Add co-applicant"
                            />
                        </Form.Group>                 

                        <span className="divider">
                            <span className="title">Co-applicant</span>
                        </span>

                        <Form.Group className="mb-18">
                            <Input
                                name="first_name"
                                type="text"
                                // defaultValue={dealer.company_name}
                                label="Co-applicant First Name"
                                defaultText="Co-applicant First Name"
                                required={true}
                                error={{
                                    'empty': "Please enter Applicant First Name"
                                }}
                                validationResult={validationResult}
                            />
                        </Form.Group>
                        <Form.Group className="mb-18">
                            <Input
                                name="last_name"
                                type="text"
                                // defaultValue={dealer.company_name}
                                label="Co-applicant Last Name"
                                defaultText="Co-applicant Last Name"
                                required={true}
                                error={{
                                    'empty': "Please enter Applicant Last Name"
                                }}
                                validationResult={validationResult}
                            />
                        </Form.Group>
                        <Form.Group className="mb-18">
                            <Input
                                name="email"
                                type="email"
                                regex="^[a-zA-Z0-9+_.-]+@[a-zA-Z0-9.-]+$"
                                // defaultValue={dealer.email}
                                label="Email"
                                defaultText="Email"
                                required={true}
                                error={{
                                    'invalid': "Please enter valid Email address",
                                    'empty': "Please enter Email Address"
                                }}
                                validationResult={validationResult}
                            />
                        </Form.Group>
                        <Form.Group className="mb-18">
                            <Input
                                name="phone"
                                type="text"
                                // defaultValue={dealer.phone}
                                label="Phone"
                                className="medium-input"
                                defaultText="999-999-9999"
                                regex="[0-9]{10}"
                                required={true}
                                error={{
                                    'invalid': "Please enter 10 digit number",
                                    'empty': "Please enter Phone number"
                                }}
                                validationResult={validationResult}
                            />
                        </Form.Group>
                        <Form.Group className="mb-18">
                            <Input
                                name="date_of_work"
                                type="date"
                                // defaultValue={dealer.phone}
                                label="Date of Birth"
                                className="medium-input"
                                defaultText="MM / DD / YYYY"
                                required={true}
                                error={{
                                    'empty': "Please enter date of birth"
                                }}
                                validationResult={validationResult}
                            />
                        </Form.Group>
                        <Form.Group className="mb-18">
                            <Input
                                name="ssn"
                                type="text"
                                // defaultValue={dealer.company_name}
                                label="SSN"
                                defaultText="SSN"
                                required={true}
                                error={{
                                    'empty': "Please enter ssn number"
                                }}
                                validationResult={validationResult}
                            />
                        </Form.Group>
                        <Form.Group className="mb-18">
                            <Input
                                name="driver_license"
                                type="text"
                                // defaultValue={dealer.company_name}
                                label="Driver License Number"
                                defaultText="Driver License Number"
                                required={true}
                                error={{
                                    'empty': "Please enter Driver License Number"
                                }}
                                validationResult={validationResult}
                            />
                        </Form.Group>
                        <Form.Group className="mb-18">
                            <Input
                                name="number_of_dependants"
                                type="number"
                                // defaultValue={dealer.company_name}
                                label="Number of Dependants"
                                defaultText="0"
                                className="small-input"
                                required={true}
                                error={{
                                    'empty': "Please enter Number of Dependants"
                                }}
                                validationResult={validationResult}
                            />
                        </Form.Group>                       
                        <Form.Group className="mb-18">
                            <Checkbox
                                name="have_co_applicant_same_address"
                                type="checkbox"
                                label="Same as Applicant"
                            />
                        </Form.Group>
                        <Form.Group className="mb-18">
                            <Input
                                name="street"
                                type="text"
                                defaultValue={dealer.street}
                                label="Street"
                                defaultText="Street"
                                required={true}
                                error={{
                                    'empty': "Please enter Street"
                                }}
                                validationResult={validationResult}
                            />
                        </Form.Group>
                        <Form.Group className="mb-18">
                            <Input
                                name="city"
                                type="text"
                                // defaultValue={dealer.city}
                                label="City"
                                defaultText="City"
                                required={true}
                                error={{
                                    'empty': "Please enter city"
                                }}
                                validationResult={validationResult}
                            />
                        </Form.Group>
                        <div className="styled-row">
                            <Form.Group className="styled-column mb-18">
                                <Input
                                    name="zip"
                                    type="number"
                                    // defaultValue={dealer.zip}
                                    regex="[0-9]{6}"
                                    label="Zip Code"
                                    defaultText="Zip Code"
                                    maxLength={6}
                                    required={true}
                                    error={{
                                        'invalid': "Please enter 6 digit number",
                                        'empty': "Please enter zip code"
                                    }}
                                    validationResult={validationResult}
                                />
                            </Form.Group>
                        </div>




                    </div>
                </div>
                <div className="footer-container">
                    <button className="secondary" type="submit">Next</button>
                </div>
            </form>

        </div>
    )
}

